import React from 'react';

export default function HomePage({ onSelectPage }) {
  return (
    <div>
        <h1>
            <span>
                SUPER
            </span>
            <span>
                SPIN
            </span>
            <span>
                WHEEL
            </span>
        </h1>
        
      <button onClick={() => onSelectPage('input')}>Configure Roulette</button>
      <button onClick={() => onSelectPage('roulette')}>View Roulette</button>
    </div>
  );
}
